const cssStyles ={
    general:{
        textAlign:'center'
    }
}

const Privacy = () => (
    <React.Fragment>
        <h1 style={cssStyles.general}>Privacy Policy</h1>

        <p style={cssStyles.general}>Use this page to detail your site's privacy policy.</p>


    </React.Fragment>

);

export default Privacy;
